Definitely,Maybe(2008)Dvdr.NL Subs.Nlt-Release(Divx)


Verenigd Koninkrijk / Verenigde Staten / Frankrijk
Komedie / Romantiek
112 minuten

geregisseerd door Adam Brooks
met Ryan Reynolds, Abigail Breslin en Isla Fisher

Will Hayes zit midden in een echtscheidingsprocedure en zijn dochtertje wil weten hoe hij haar moeder ontmoet heeft. Will vertelt haar van de vrouwen die destijds in zijn leven waren en laat zijn dochter raden met wie hij uiteindelijk getrouwd is. Zou het zijn studievriendin Emily zijn? Of zijn beste vriendin en vertrouwelinge April? Of de vrijgevochten journaliste Summer?

Het is Engels gesproken en Nederlands ondertiteld.

